import React, { useEffect } from 'react';

const SkillsForm = () => {

    useEffect(() => {
        fetch('https://emsiservices.com/skills/versions/latest/skills')
        .then(response => {
            if (!response.ok){
                throw new Error(`HTTP Error, status code: ${response.status}`)
            }
            return response.json()
        })
        .then(data => { console.log(data) })
        .catch(error => {
            console.log(error)
        })
    },[])

    return(
        <div><h1>This is the Skills Form page</h1></div>
    )
}

export default SkillsForm;
